import RAPIER from "@dimforge/rapier2d-compat"
import {useThree } from "@react-three/fiber"
import { decompressFromBase64 } from "lz-string"
import { useMemo } from "react"
import { RuntimeSystemContext, RuntimeSystemStack } from "runtime/src/core/RuntimeSystemStack"
import { commonGamemode } from "runtime/src/gamemode/CommonGamemode"
import tunnel from "tunnel-rat"

import { newRuntime } from "../../../runtime/src/Runtime"
import { WorldModel } from "../model/world/WorldModel"
import Overlay from "./overlay/Overlay"
import { useWebappRuntime } from "./runtime-runner/useWebappRuntime"
import { RuntimeView } from "./runtime-view/RuntimeView"

// eslint-disable-next-line @typescript-eslint/no-unused-vars
const rapierInit = RAPIER.init()

const overlay = tunnel()

function Game(props: { world: WorldModel }) {
    const world = JSON.parse(JSON.stringify(props.world)) // dirty hack to prototype for now. fix later
    // const { context, stack } = newWebappRuntime(commonGamemode, world)

    const success = useMemo(() => {
        for (let i = 0; i < 20; ++i) {
            const pnow = performance.now()
            const { context, stack } = newRuntime(commonGamemode, world)
            
            const decompressed: RuntimeSystemContext[] = JSON.parse(decompressFromBase64(""))
    
            for (let i = 0; i < decompressed.length; i++) {
                stack.step(decompressed[i])
            }
            
            const levels = context.store.find("level")
    
            if (context.store.world.has("world")) {
                const delta = performance.now() - pnow
                console.log(`finished?=${context.store.world.components.world.finished}, completed levels: ${levels.filter(level => level.components.level.captured).length}/${levels.length} after ${delta}ms`)

                if (context.store.world.components.world.finished === false) {
                    return false
                }
            }
        }

        return true
    }, [])

    return (
        <>
            <div className="bg-base-300 p-8 rounded">
                Det success: {success.toString()}
            </div>
        </>
        /*
        <ProvideGameStore systemContext={context}>
            <div className="h-screen w-screen select-none" style={{
                touchAction: "none", 
                userSelect: "none",

                // Prevent canvas selection on ios
                // https://github.com/playcanvas/editor/issues/160
                WebkitTouchCallout: "none",
                WebkitUserSelect: "none",
                WebkitTapHighlightColor: "rgba(255,255,255,0)",
            }}>
                <Canvas style={{ 
                    background: "#000000",
                    touchAction: "none", 
                    userSelect: "none",
    
                    // Prevent canvas selection on ios
                    // https://github.com/playcanvas/editor/issues/160
                    WebkitTouchCallout: "none",
                    WebkitUserSelect: "none",
                    WebkitTapHighlightColor: "rgba(255,255,255,0)",
                }} >
                    <Suspense>
                        <InnerGame stack={stack} />
                    </Suspense>
                </Canvas>
        
                <overlay.Out />
            </div>
        </ProvideGameStore>*/
    )
}

function InnerGame(props: { stack: RuntimeSystemStack }) {
    useWebappRuntime(props.stack)
    
    const camera = useThree(state => state.camera) as THREE.OrthographicCamera

    return (
        <>    
            <overlay.In>
                <Overlay camera={camera} />
            </overlay.In>
            
            <RuntimeView/>
        </>
    )
}

export default Game
